// src/pages/Article4.jsx
import React, { useEffect, useRef } from 'react';
import { gsap } from 'gsap';
import { Link } from 'react-router-dom';
import Navbar from '@/components/Navbar';
import Footer from '@/components/Footer';
import { Badge } from '@/components/ui/badge';
import { Button } from '@/components/ui/button';
import { Separator } from '@/components/ui/separator';
import { ArrowLeft, ArrowRight, Clock, Share2 } from 'lucide-react';

const Article4 = () => {
  const contentRef = useRef(null);
  const imageRef = useRef(null);

  useEffect(() => {
    window.scrollTo(0, 0);

    if (imageRef.current) {
      gsap.from(imageRef.current, {
        opacity: 0,
        scale: 1.05,
        duration: 1,
        ease: 'power3.out',
      });
    }

    if (contentRef.current) {
      gsap.from(contentRef.current.children, {
        opacity: 0,
        y: 30,
        duration: 0.8,
        stagger: 0.08,
        ease: 'power2.out',
        delay: 0.3,
      });
    }
  }, []);

  return (
    <div className="min-h-screen bg-background">
      <Navbar />

      <div ref={imageRef} className="relative h-[60vh] overflow-hidden">
        <img
          src="https://images.unsplash.com/photo-1544005313-94ddf0286df2"
          alt="Article 4 hero"
          className="w-full h-full object-cover"
        />
        <div className="absolute inset-0 bg-gradient-to-t from-background via-background/60 to-transparent"></div>
      </div>

      <article className="max-w-4xl mx-auto px-4 sm:px-6 lg:px-8 -mt-32 relative z-10">
        <div ref={contentRef} className="bg-card border border-border rounded-lg shadow-2xl p-8 md:p-12">
          <div className="mb-8">
            <div className="flex flex-wrap gap-2 mb-4">
              <Badge className="bg-[hsl(var(--primary))] text-primary-foreground">Serial Killers</Badge>
              <Badge variant="outline">USA</Badge>
            </div>

            <h1 className="text-4xl md:text-5xl font-bold text-foreground mb-4 leading-tight">
              Title for Article 4
            </h1>

            <div className="flex items-center gap-4 text-sm text-muted-foreground">
              <div className="flex items-center gap-1">
                <Clock size={16} />
                <span>10 min read</span>
              </div>
              <span>•</span>
              <span>January 18, 2025</span>
              <span>•</span>
              <button className="flex items-center gap-1 hover:text-[hsl(var(--primary))] transition-colors">
                <Share2 size={16} />
                <span>Share</span>
              </button>
            </div>
          </div>

          <Separator className="mb-8" />

          <div className="prose prose-invert max-w-none">
            <p className="text-lg text-muted-foreground leading-relaxed mb-6">
              Replace this paragraph with the Article 4 body.
            </p>

            {/* ...rest of article content... */}
          </div>

          <Separator className="my-8" />

          <div className="flex justify-between items-center">
            <Link to="/article/sharma">
              <Button variant="outline" className="hover:bg-muted">
                <ArrowLeft size={16} className="mr-2" />
                Previous Article
              </Button>
            </Link>
            <Link to="/">
              <Button className="bg-[hsl(var(--primary))] hover:bg-[hsl(var(--primary-glow))] text-primary-foreground">
                Back to Home
                <ArrowRight size={16} className="ml-2" />
              </Button>
            </Link>
          </div>
        </div>
      </article>

      <div className="mt-20">
        <Footer />
      </div>
    </div>
  );
};

export default Article4;
